import{_ as t,c as e,o as a,b as r}from"./app.a754b1b5.js";var i="/ui-toolbox-import.gif",n="/ui-projectoverview.png";const f=JSON.parse('{"title":"Importera ett projekt till Prodikt","description":"","frontmatter":{},"headers":[{"level":2,"title":"Introduktion","slug":"introduktion"},{"level":2,"title":"1. S\xE4kerst\xE4ll produtspecifik data","slug":"_1-sakerstall-produtspecifik-data"},{"level":2,"title":"2. Importera & granska produkter","slug":"_2-importera-granska-produkter"},{"level":2,"title":"3.\\tOptimera projektet","slug":"_3-optimera-projektet"},{"level":2,"title":"4.\\tAnalysera & rapportera","slug":"_4-analysera-rapportera"}],"relativePath":"documentation/funktioner/importera_projekt/index.md"}'),o={name:"documentation/funktioner/importera_projekt/index.md"},d=r('<h1 id="importera-ett-projekt-till-prodikt" tabindex="-1">Importera ett projekt till Prodikt <a class="header-anchor" href="#importera-ett-projekt-till-prodikt" aria-hidden="true">#</a></h1><h2 id="introduktion" tabindex="-1">Introduktion <a class="header-anchor" href="#introduktion" aria-hidden="true">#</a></h2><p>Prodikt st\xF6ttar befintliga processer</p><p>Vi tror verkligen att vi har byggt n\xE5got bra men vi vet ocks\xE5 att dina och ditt team\u2019s befintliga processer \xE4r viktiga.</p><p>Vid en import av en IFC-fil (3D-modell) eller en Excel-fil (kalkyl/materiallista) till ett projekt i Prodikt s\xE5 analyseras den data som importeras och matchas mot antingen produkter eller system som finns i Prodikt. F\xF6r att f\xE5 produktspecifik data utan att anv\xE4ndaren ska beh\xF6va r\xE4kna om eller samla in n\xE5gon data s\xE5 kan nedan steg f\xF6ljas.</p><h2 id="_1-sakerstall-produtspecifik-data" tabindex="-1">1. S\xE4kerst\xE4ll produtspecifik data <a class="header-anchor" href="#_1-sakerstall-produtspecifik-data" aria-hidden="true">#</a></h2><p>M\xE5nga tillverkare har redan registrerat sina produkter i Prodikt, men f\xF6r att s\xE4kerst\xE4lla att de produkter som \xE4r relevanta f\xF6r projektet finns tillg\xE4ngliga s\xE5 b\xF6r en kravst\xE4llning g\xF6ras r\xF6rande produkternas registrering i Prodikt. P\xE5 s\xE5 s\xE4tt kan det s\xE4kerst\xE4llas att produktspecifik data finns l\xE4ttillg\xE4ngligt.</p><p>Hj\xE4lp med kravst\xE4llningen kan f\xE5s genom att l\xE4sa: \u201DF\xF6reskriftstexter \u2013 Privat sektor\u201D eller \u201DF\xF6reskriftstexter \u2013 Offentlig sektor\u201D.</p><p>Skulle en produkt sakna visst underlag och det accepteras i exempelvis en upphandling, d\xE5 kan produkten registreras i Prodikt likv\xE4l. Produkten kommer d\xE5 ha vissa luckor i sitt produktkort, men n\xE4r produkten l\xE4ggs till i ett projekt kommer generisk data automatiskt att tilldelas produkten vilket underl\xE4ttar f\xF6r anv\xE4ndaren.</p><p>L\xE4s mer om produktsidan h\xE4r: <a href="/documentation/kom_igang/produktsida/">Produktsida</a></p><h2 id="_2-importera-granska-produkter" tabindex="-1">2. Importera &amp; granska produkter <a class="header-anchor" href="#_2-importera-granska-produkter" aria-hidden="true">#</a></h2><p>I ett projekt kan olika typer av filer importeras.</p><p><img src="'+i+'" alt="Importera"></p><p>Om en Excelfil ska importeras kan en standardmall enkelt laddas ner vilken importen st\xF6djer.</p><table><thead><tr><th>ProdiktID</th><th style="text-align:center;">Name</th><th>Manufacturer</th><th>Qty</th><th>Unit</th><th>GTIN</th><th>art_nr</th><th>Floor</th><th>Tags</th><th>Identifier</th><th>Length</th><th>Width</th><th>Height</th><th>Thickness</th><th>Diameter</th><th>Weight</th></tr></thead><tbody><tr><td>xxxxxx</td><td style="text-align:center;">xxxx</td><td>xxxx</td><td>xxx</td><td>xx</td><td></td><td></td><td></td><td></td><td></td><td></td><td></td><td></td><td></td><td></td><td></td></tr></tbody></table><p>Skulle anv\xE4ndaren ing\xE5 i en organisationsplan s\xE5 kan importen konfigureras f\xF6r att st\xF6dja organisationsspecifika Excelmallar. Om en IFC-fil ska importeras s\xE5 har Prodikt fullt st\xF6d f\xF6r alla olika modeller.</p><p>Oavsett vad f\xF6r typ av fil som importeras s\xE5 matchas <strong>artikelnummer/GTIN/bim-objekt</strong> med produkter i Prodikts databas. I projektet visas i procent m\xE4ngden produktspecifik data. D\xE4rmed \xE4r det enkelt att avg\xF6ra och uppt\xE4cka ifall n\xE5gon produkt i projektet baseras p\xE5 generisk data.</p><h2 id="_3-optimera-projektet" tabindex="-1">3. Optimera projektet <a class="header-anchor" href="#_3-optimera-projektet" aria-hidden="true">#</a></h2><p>Skulle en import inte ge en fullst\xE4ndig matchning kan detta antingen bero p\xE5 att produkten fattades i produktdatabasen alternativt att importfilen inneh\xF6ll bristf\xE4llig data, ex. avsaknad av <strong>artikelnummer/GTIN/bim-objekt</strong>.</p><p>I projektet \xE4r det enkelt att skilja p\xE5 generisk och specifik data. Det \xE4r \xE4ven lika enkelt att byta ut en eller flera produkter p\xE5 en g\xE5ng.</p><h2 id="_4-analysera-rapportera" tabindex="-1">4. Analysera &amp; rapportera <a class="header-anchor" href="#_4-analysera-rapportera" aria-hidden="true">#</a></h2><p>N\xE4r projektet \xE4r fullst\xE4ndigt kan en analys enkelt g\xF6ras utifr\xE5n sammanst\xE4llningen som finns f\xF6r klimatp\xE5verkan, cirkularitet och h\xE4lsa/material i projektvyn. En projektrapport kan skapas samt att en klimatdeklaration kan uppr\xE4ttas om det kravet skulle finnas.</p><p><img src="'+n+'" alt="Importera"></p>',23),s=[d];function l(p,k,h,m,u,g){return a(),e("div",null,s)}var _=t(o,[["render",l]]);export{f as __pageData,_ as default};
